import React from 'react';

const FlightDetails: React.FC = () => {
    return (
        <div className="landing-page">
            <div className="flight-details">
                <h1>Hello, Brandon</h1>
                <p>Your flight number: XXXXXX</p>
            </div>
        </div>
    );
};

export default FlightDetails;
